('1968','18','7658','Villa Christine B-Connected',Null,'Bezaubernde Villa im Finca-Stil in der Nähe von Santa Maria','25028','Die Villa im Finca-Stil steht nur 4 km außerhalb des berühmten Weinanbauortes Santa Maria entfernt. Sie wurde auf einem flachen, ca. 15.000 m² großen Grundstück im Jahre 1998 erstellt. Das Haupthaus beherbergt das Wohn-Esszimmer mit TV-Zimmer und Blick in den mediterranen Garten und den Pool, eine große Ess-Küche und ein Gäste-WC. \r\nIm Obergeschoss befinden sich das Master-Schlafzimmer mit Bad en suite, 2 Schlafzimmer und ein weiteres Badezimmer. Das separate Gästehaus hat ca. 100 m², die sich auf 2 Etagen verteilen. Im Erdgeschoss liegt das Wohnzimmer und in der oberen Etage ein Schlafzimmer und ein Badezimmer. Ein weiteres Gästeapartment mit Schlafzimmer und Badezimmer ist am Poolhaus untergebracht. Auch ein separates Angestelltenzimmer mit Küche ist vorhanden.\r\nGeheizt wird das Haus über eine Ölzentralheizung (teilweise Fußbodenheizung). Zwei Autos finden in der Garage platz. Wer möchte, kann seine Golfabschläge auf der hauseigenen Drivingrange üben. ','25029','1980000','111','2013-02-21 16:52:34','106','2013-02-21 16:53:00',Null,'1731','120','680',1,'1','0',Null,Null,Null,'25030',Null,'0','0','0',Null,'2015-10-26 10:09:14',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'25031',Null,'25032',Null,'25033',Null,'25034',Null,'25035','0',0,'0');
